import { Card, CardContent, Grid, makeStyles, TextField } from '@material-ui/core';
import React from 'react';
import AdminLink from '../management/AdminLinks';

const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
    },
    gridContainer: {
      paddingTop:"20px",
      minHeight:"100vh"
    },
    paper: {
        padding: theme.spacing(2),
        textAlign: 'center',
        color: theme.palette.text.secondary,
      },
    headPart:{
        backgroundColor:"#133b5c",
      color:"#ffff"
    },
    icon:{
        color:"#fff"
    },
    categorytitle:{
        color:"#133b5c",
        fontSize:"35px",
        fontWeight:"600",
        textAlign:"center"
    },
    heading: {
      fontSize: theme.typography.pxToRem(20),
      fontWeight: theme.typography.fontWeightRegular,
    },
  }));

function CreateQuiz() {
    const classes = useStyles();
    return (
        <div className={classes.root}>
        <AdminLink/>
        <h3 className={classes.categorytitle}></h3>
          <Grid
                container
                className={classes.gridContainer}
                justify="center"
             >
                    <Grid container>
                    <Grid item xs></Grid>
                    <Grid item xs={11} sm={6} md={6} lg={4} >
                      <Card className="questioncard">
                         <div className="optioncard">
                                  <Grid
                                  container
                                  className="nonclickoption"
                                 >
                               <input  type="text" id="username" className="title-text"
                            name="username"
                            placeholder="User Name"
                            />
                               </Grid>

                        </div>

                      </Card>
                    </Grid>
                    <Grid item xs></Grid>
                  </Grid>
         </Grid>
        </div>
    )
}

export default CreateQuiz
